import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { Cell } from "./components";

class App extends Component {
  state = {
    cells: []
  };

  componentWillMount() {
    this.populateBoard();
  }

  populateBoard() {
    for (let i = 0; i <= 81; i++) {
      this.state.cells.push(i);
    }
  }

  renderGameBoard() {
    console.log(this.state.cells);
    return this.state.cells.map(cell => <Cell />);
  }

  render() {
    return <div className="cellView">{this.renderGameBoard()}</div>;
  }
}

export default App;
